import "../styles/cart.scss";

const Cart = (props) => {
  const cartItems = props.productItems;

  return (
    <div className="cart__container">
      <div className="container__content">
        <h1>My order</h1>
        {cartItems.length === 0 && <div className="content__orders">
          <h2>Your cart is empty</h2>
        </div>}
        {cartItems.map(item => {
          <div key={item.id}>
            <div>{item.name}</div>
            <div>{item.price}</div>
          </div>
        })}
        <div className="content__total">
          <h2>0.00z≈Ç</h2>
          <button>Checkout</button>
        </div>
      </div>
    </div>
  );
};

export default Cart;
